INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Bệnh viện Hữu nghị Việt Đức', 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Địa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</p>\n<p>Thời gian làm việc: Thứ 2 đến thứ 7</p>\n<p>Sáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n', '**GIỚI THIỆU**\n\nĐịa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\nSố 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\nThời gian làm việc: Thứ 2 đến thứ 7\n\nSáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. ', , '2023-07-11 10:42:27', '2023-07-11 10:42:27');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Bệnh viện Chợ Rẫy', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p>Địa chỉ bệnh viện:</p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p>Thời gian làm việc:</p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>Thứ 2 đến thứ 6: từ 7h – 16h</li>\n<li>Thứ 7: từ 7h – 11h</li>\n</ul>\n<p><strong>Sơ đồ Bệnh viện Chợ Rẫy</strong>\n<img src=\"https://bookingcare.vn/files/blog/2021/09/14/160246-so-do-bv-rut-gon.jpg?w=1000\" alt=\"img\"></p>\n', '**GIỚI THIỆU**\n\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\nĐịa chỉ bệnh viện:\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\nThời gian làm việc:\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n* Thứ 7: từ 7h – 11h\n\n**Sơ đồ Bệnh viện Chợ Rẫy**\n ![img](https://bookingcare.vn/files/blog/2021/09/14/160246-so-do-bv-rut-gon.jpg?w=1000)', , '2023-07-11 10:43:41', '2023-07-11 10:43:41');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, 'Phòng khám Bệnh viện Đại học Y Dược 1', '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', '<p>Từ nay, người bệnh có thể đặt khám Phòng khám Bệnh viện Đại học Y Dược 1 thông qua hệ thống đặt khám BookingCare.</p>\n<ul>\n<li>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm</li>\n<li>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)</li>\n<li>Giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám</li>\n<li>Nhận được hướng dẫn đi khám chi tiết sau khi đặt lịch</li>\n</ul>\n', 'Từ nay, người bệnh có thể đặt khám Phòng khám Bệnh viện Đại học Y Dược 1 thông qua hệ thống đặt khám BookingCare.\n\n* Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\n* Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\n* Giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám\n* Nhận được hướng dẫn đi khám chi tiết sau khi đặt lịch', , '2023-07-11 10:44:16', '2023-07-11 10:44:16');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(5, 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', '<p>Từ nay, người bệnh có thể đặt lịch tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108 thông qua hệ thống đặt khám BookingCare:</p>\n<ul>\n<li>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)</li>\n<li>Lựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu</li>\n<li>Được lựa chọn khám với Bác sĩ Chuyên khoa</li>\n<li>Giảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước</li>\n</ul>\n', 'Từ nay, người bệnh có thể đặt lịch tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108 thông qua hệ thống đặt khám BookingCare:\n\n* Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\n* Lựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu\n* Được lựa chọn khám với Bác sĩ Chuyên khoa\n* Giảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước', , '2023-07-11 10:44:58', '2023-07-11 10:44:58');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, 'Bệnh viện Ung bướu Hưng Việt', '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', '<p>Từ nay, người bệnh có thể đặt khám Bệnh viện Ung bướu Hưng Việt thông qua hệ thống đặt khám BookingCare:</p>\n<ul>\n<li>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm</li>\n<li>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)</li>\n<li>Đặt lịch khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám</li>\n<li>Nhận hướng dẫn chi tiết sau khi đặt lịch</li>\n</ul>\n', 'Từ nay, người bệnh có thể đặt khám Bệnh viện Ung bướu Hưng Việt thông qua hệ thống đặt khám BookingCare:\n\n* Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\n* Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) \n* Đặt lịch khám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khám\n* Nhận hướng dẫn chi tiết sau khi đặt lịch', , '2023-07-11 10:45:31', '2023-07-11 10:45:31');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, 'Trung tâm xét nghiệm Diag Laboratories', '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', '<p>Hãy đặt lịch với Trung tâm xét nghiệm Diag Laboratories trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:</p>\n<ul>\n<li>Được lựa chọn dịch vụ y tế chất lượng</li>\n<li>Đặt hẹn trực tuyến &amp; nhận hướng dẫn chi tiết trước khi đến (miễn phí)</li>\n<li>Giảm thiểu thời gian chờ đợi</li>\n</ul>\n', 'Hãy đặt lịch với Trung tâm xét nghiệm Diag Laboratories trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:\n\n* Được lựa chọn dịch vụ y tế chất lượng\n* Đặt hẹn trực tuyến & nhận hướng dẫn chi tiết trước khi đến (miễn phí)\n* Giảm thiểu thời gian chờ đợi', , '2023-07-11 10:46:01', '2023-07-11 10:46:01');

